//*****navigateBSP*****
// Recursively navigate binary partition tree to draw from near to far
// Input: index of node in node array
// Output: return 1 to indicate rendering finished and exit recursion
static uint8_t navigateBSP(uint16_t nodeIndex) {
	if (nodeIndex >= 32768) {
		if (renderSubSector(nodeIndex & 0x7FFF))	return 1;
		else	return 0;
	}
	Node node = nodeList[nodeIndex];
//	printf("v1 (%d,%d)\n", node.x, node.y);
//	printf("d (%d,%d)\n", node.dx, node.dy);
	// Todo: Use bounding box to discard entire nodes
	uint16_t primaryChild, secondaryChild;
	if (crossProduct((player.x-node.x),(player.y-node.y),node.dx,node.dy) > 0) {
		primaryChild = node.rightChild;
		secondaryChild = node.leftChild;
	} else {
		primaryChild = node.leftChild;
		secondaryChild = node.rightChild;
	}
	
	if (navigateBSP(primaryChild))	return 1;
	if (navigateBSP(secondaryChild))	return 1;
	
	return 0;
}

//*****renderSubSector*****
// Render subsector using subsectorIndex
// Input: index of subsector in subsector array
// Output: return 1 to indicate rendering finished and exit recursion
static uint8_t renderSubSector(uint16_t subsectorIndex) {
	static const Seg *seg;
	//static const Sidedef *sidedef;		only needed if multiple levels
	static const SSector *ssector;
	ssector = &ssectorList[subsectorIndex];
// 	Possible optimisation: declare outside to speed up on run time
//	float vx1, vx2, vy1, vy2, tx1, tx2, ty1, ty2, parallel, cx1, cy1, cx2, cy2, dx, dy, z1, z2, xOffset, scale;
//	int16_t rangeTop, rangeBottom, rangeX, x1, x2, y1Bottom, y1Top, y2Bottom, y2Top, x, y1, y2;
//	uint8_t patchIndex, textHeight, textWidth;
//	const unsigned short *textPtr;
	
	for (uint16_t i = ssector->startSeg; i < ssector->startSeg + ssector->numSeg; i++) {
		if (segRendered == maxSeg)	return 1;	// Max segment rendered
		
		seg = &segList[i];
		//sidedef = &sidedefList[linedefList[seg->linedef].rightSide];	only needed if multiple levels
		uint8_t patchIndex = sidedefList[linedefList[seg->linedef].rightSide].middle;
		if (patchIndex == 255)	continue;	// Transparent
		
		if (collisionCount < maxCollision)	collisionList[collisionCount++] = *seg;	// Add rendered segment to collision list
		// Loop through all vertices
//		printf("startV %d\n", seg->startVertex);
//		printf("endV %d\n", seg->endVertex);
		int16_t vx1 = vertexList[seg->startVertex].x - player.x;
		int16_t vx2 = vertexList[seg->endVertex].x - player.x;
		int16_t vy1 = vertexList[seg->startVertex].y - player.y;
		int16_t vy2 = vertexList[seg->endVertex].y - player.y;
		
		// Backface culling
		if (dotProduct(vx1, vy1, (vy1-vy2), (vx2-vx1)) < 0)	continue;
		
		// Transform to player view
		float cx1,tx1,cy1,ty1,cx2,tx2,cy2,ty2;
		cx1 = tx1 = (vx1*pcos) + (vy1*psin); 
		cy1 = ty1 = (vy1*pcos) - (vx1*psin);
		cx2 = tx2 = (vx2*pcos) + (vy2*psin); 
		cy2 = ty2 = (vy2*pcos) - (vx2*psin);
		
		// Clipping
		if (tx1 <= 0 && tx2 <= 0) continue;		// Completely behind player
		uint8_t leftClipped = 0, clipped = 0;	// Used for texture clipping
		float dx = tx2 - tx1, dy = ty2 - ty1, t1 = (tanFOV*tx1-ty1) / (dy-tanFOV*dx), t2 = - (tanFOV*tx1+ty1) / (dy+tanFOV*dx);
		if (ty1 > tx1*tanFOV) {
			if (ty2 > tx2*tanFOV) continue;		// Both outside of frustrum
			if (crossProduct(dx,dy,xFOV,yFOV) == 0)	continue;	// parallel to FOV
			cx1 = tx1 + t1 * dx;
			cy1 = ty1 + t1 * dy;
			leftClipped = 1;
			clipped = (uint8_t)sqrt(t1*t1*dx*dx + t1*t1*dy*dy);
		}
		if (ty1 < -tx1*tanFOV) {
			if (ty2 < -tx2*tanFOV) continue;		// Both outside of frustrum
			if (crossProduct(dx,dy,-xFOV,-yFOV) == 0)	continue;	// parallel to FOV
			cx1 = tx1 + t2 * dx;
			cy1 = ty1 + t2 * dy;
			clipped = (uint8_t)sqrt(t1*t1*dx*dx + t1*t1*dy*dy);
		}
		if (ty2 > tx2*tanFOV) {
			if (ty1 > tx1*tanFOV) continue;		// Both outside of frustrum
			if (crossProduct(dx,dy,xFOV,yFOV) == 0)	continue;	// parallel to FOV
			cx2 = tx1 + t1 * dx;
			cy2 = ty1 + t1 * dy;
		}
		if (ty2 < -tx2*tanFOV) {
			if (ty1 < -tx1*tanFOV) continue;	// Both outside of frustrum
			if (crossProduct(dx,dy,-xFOV,-yFOV) == 0)	continue;	// parallel to FOV
			cx2 = tx1 + t2 * dx;
			cy2 = ty1 + t2 * dy;
		}
		
		segRendered++;
				
		//z1 = sectorList[sidedef->sector].floorHeight -  player.z;
		//z2 = sectorList[sidedef->sector].ceilingHeight - player.z;
		float z1 = 0 - player.z;
		float z2 = 72 - player.z;
		
		// Perspective transform
		int16_t x1 = -cy1 * focalX / cx1 + W/2;	// Using seperate focal lengths for x and y
		int16_t x2 = -cy2 * focalX / cx2 + W/2;
		int16_t y1Bottom = z1 * focalY / cx1 + H/2;
		int16_t y1Top = z2 * focalY / cx1 + H/2;
		int16_t y2Bottom = z1 * focalY / cx2 + H/2;
		int16_t y2Top = z2 * focalY / cx2 + H/2;

		// Linear interpolation
		x1 = range(x1, 0, W-1);
		x2 = range(x2, 0, W-1);
		float bottomIncrement = (double)(y2Bottom-y1Bottom) / (x2 - x1);
		float topIncrement = (double)(y2Top-y1Top) / (x2 - x1);
		int16_t cdx = cx2 - cx1;
		int16_t cdy = cy2 - cy1;

		uint8_t textHeight = textures[patchIndex].height;
		uint8_t textWidth = textures[patchIndex].width;
		const unsigned short *textPtr = textures[patchIndex].texture;
		float xScale = 0, yScale = 0, xOffset = 0, z;
		if (leftClipped) xOffset = clipped % textWidth;	// Texture clipping
		int16_t y1, y2, yOffset;
		uint8_t base;
//		y1 = y1Bottom - bottomIncrement; y2 = y1Top - topIncrement;
		for (int16_t x = x1; x < x2; x++) {
			// Alternate rendering method, faster in the expense of quality
			//y1 = range((y1 + bottomIncrement), 0, H-1);
			//y2 += topIncrement;
			z = (cx1 * cdy - cy1 * cdx)/(cdy + (float)(x-W/2) / focalX * cdx);
			if (z >= zBuffer[x])	//rudimentary z buffer
				continue;
			else {
				zBuffer[x] = z;
				if (zBufferCount++ == W) return 1;	// Exit if whole screen has been updated
			}
			y1 = range((y1Bottom + (x - x1) * bottomIncrement), 0, H-1);
			y2 = (y1Top + (x - x1) * topIncrement);
			
			yOffset = 0;
			if (y2 > H-1) {
				yOffset = y2 - H + 1;
				y2 = H-1;
			}
			y2 = y2 < 0 ? 0 : y2;
			xScale = (float)z/focalX;
			yScale = (float)z/focalY;
			
			base = 0;
			// Avoid drawing over title
			if (playingTitle && x >= 18 && x <= 143) {
				base = (screenHeight-title.height)/2 + title.height - 32;
				if (y1 <= base) y1 = base;
				if (y2 <= base) y2 = base;
				goto skipGun;
			}
			
			// Avoid drawing over the gun
			if (x >= 67 && x <= 92)	{
				base = gun.space[x-67];
				if (y1 <= base)	y1 = base;
				if (y2 <= base) y2 = base;
			}
			
			skipGun:
			if (y1)	ST7735_DrawFastHLine(base+HUDHeight, x, y1, floor);	// Floor
			ST7735_DrawFastHLineTexture(y1+HUDHeight, x, y2 - y1, (uint8_t)xOffset, (uint8_t)yOffset, yScale, textPtr, textWidth);
			if (y2 < H)	ST7735_DrawFastHLine(y2+HUDHeight, x, H - y2, ceiling);	// Ceiling
			xOffset += xScale;
			xOffset = xOffset > textHeight-1 ? 0 : xOffset;
		}
	}
	return 0;
}

